import React from 'react'

function Header(props) {
    return (
        <header>
            <h1>Sunny Gang Game</h1>
            <div className = "scoreboard">
                <h1 style = {{ position: "absolute", top: "0", right: "0" }}>Score: {props.score}</h1> | <h1 style = {{ float: "right" }}>Streak: {props.streak}</h1>
            </div>

        </header>
    )
}
export default Header;
